Alektra Blue, Bailey Brooks, Briana Blair, Dale Dabone, Eric Masterson, Kirsten Price, Mick Blue, Tessa Taylor, TJ Cummings

With a big promotion dangling overhead, Jennifer (Kirsten Price) will do just about anything to get ahead. And with the help of her hilarious side kicks, they hatch a plan to take out the competition. But Veronika (Alektra Blue) isn`t going down without a fight. It`s a dog eat dog world out there and sometimes you get bitten.
